            def rotate_by_unique_letters(text):
                def rotate_token(tok):
                    letters = [c for c in tok if c.isalpha()]
                    if not letters:
                        return tok

                    k = len({c.lower() for c in letters}) % len(letters)
                    if k == 0:
                        return tok

                    rot = letters[-k:] + letters[:-k]
                    out = []
                    j = 0
                    for c in tok:
                        if c.isalpha():
                            out.append(rot[j])
                            j += 1
                        else:
                            out.append(c)
                    return "".join(out)

                return " ".join(rotate_token(t) for t in text.split(" "))

